:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, James Nelson and BEETHAM, Mary-Margaret
  JWILLIAMS, Arnold Beetham and BEALE, Emma Reremoana
  JWILLIAMS, Margaret Octavia and WILLIAMS, Anthony John Oswald
  03> WILLIAMS, Margaret Octavia m on 17.08.1946 to WILLIAMS, Anthony John Oswald
  b 31.05.1920
  b 31.03.1918
  Margaret b. at Waipiro Bay (adopted) and m. at Te Puia Springs. Anthony, slo of Oswald Temple Williams and
  Violet Lethridge Wood, b, at Gisborne.
  Biographical notes and descendants of Margaret and Anthony are listed under Anthony's entry in this Family
  Tree.
  03> WILLIAMS, Winifred Beetham m on 23.11.1893 to. NELSON, Francis Ernest
  b 18.01.1872 d 17.03.1935
  b 16.01.1869 d 26.07.1937
  Winifred b, at Frimley, m. at St Matthew's Church, Hastings and d. at "Rouncil". Frank, slo Charles Nelson of
  Kenilworth, Warwicks, England.
  Winifred was a foundation trustee of Woodford House School, Havelock North, and also of Royston Hospital. At
  "Rouncil" she established a collection of native trees.
  On coming to New Zealand, Frank worked for his uncle, William Nelson, at Tomoana Freezing Works. On their
  marriage they built "Eversleigh". After a period in England in the family Gelatine business he returned to
  Hawkes Bay and farmed at "Rouncil". He was also involved in JN Williams' timber milling interests, often
  having to travel to Australia and the central North Island, and was a director of Odlin's Timber Co. .
  01> NELSON, Alice Ruth
  b 22.08.1894 d 24.07.1977
  Ruth b. at Eversley. Following a trip to Europe in the 1920's where she met leading anthroposophists, Ruth
  was instrumental in the development of the movement in New Zealand and it became her lifelong interest. In
  1946 Ruth, with her sister, Gwen, purchased "Kereru" station which had at one time belonged to their
  grandfather, JN Williams, and under their ownership it became one of the leading pastoral properties in
  Hawkes Bay. In 1966 Ruth and Gwen each formed their share of the station into a charitable trust which
  continues to support a range of activities.
  Ruth was largely responsible for the establishment of the Rudolph Steiner School in Hastings. In 1950 she
  and others bought the then Queenswood School for this purpose.
  Ruth also carved the altar in the Woodford House Chapel at Havelock North.
  02> NELSON, Winifred Gwendoline m on ** ** 1945 to MALDEN, Henry
  b 15.07.1897 d 13.12.1973
  b ** ** **** d 17.05.1963
  Gwendoline b. at Eversley. Gwen was interested in the arts and was well regarded as a painter herself. In
  recognition of her support of the Hawkes Bay Museum in Napier, the Gwen Malden Gallery was named after her.
  She took an active part in the Anthroposophical Movement and was responsible for the establishment of
  Weleda in Hawkes Bay.
  03> NELSON, James Francis (Jim) m on 19.10.1935 to (1) PALMER, Patricia Florence
  b 23.04.1903 d 17.10.1995
  b 15.05.1914 d 18.01.1968
  Jim b. at Kenilworth, England. He was educated at Heretaunga and Christ's College (head prefect) and Merton
  College, Oxford. He was then involved with the Oxford Bermondsey Boys' Club in the East End of London. He
  attended Cuddesdon Theological College for a year before returning to New Zealand. He became involved with
  many educational, religious and social organisations especially Hereworth School, Hawkes Bay Childrens'
  Homes and St Luke's Church, Havelock North. He did Home Service in the NZ Army during WW2. Jim was chairman
  of the organising committee for the Williams Family Reunion held at Paihia in 1973.
  01> NELSON, Jane Palmer m on 14.01.1956 to TYLEE, Robert Michael
  b 27.09.1936
  b 26.11.1930
  Jane b. at Hastings and m. at St Luke's Church, Havelock North. Michael, s/o John Perry Tylee and Alice
  Helen Miller, Address: Te Mata-Mangateretere Road, RD 2, Hastings.
  Jane and Michael farmed at Elsthorpe, Hawkes Bay for 28 years and are now orcharding at Mangateretere.
